_G.mt.__namecall = newcclosure(function(self,...)
	local args = {...}
	local namecall = getnamecallmethod()

	if namecall == "FindPartOnRayWithIgnoreList" then
		if target and plr.Character and rage then
			local X = plr.Character.HumanoidRootPart.CFrame.p + Vector3.new(0, 1.4, 0)
			args[1] = Ray.new(X, CFrame.new(X, target.CFrame.p).lookVector.unit * 250)
		end	  
	end
	if namecall == "FireServer" and self.Name == "HitPart" and tick() - lasthittick > 0.005 and script.Parent.Parent.Parent.Parent.Parent.Visual.Main.OtherESPTab.Tracers.BulletTracers.BULLETTRACERS.Value == true then
		lasthittick = tick()
		spawn(function()
			local X = plr.Character.HumanoidRootPart.CFrame.p + Vector3.new(0, 1.4, 0)
			local beam = createBeam(X, args[2])
			for i = 1, 60 * lifetime do
				rs:Wait()
				beam.Transparency = NumberSequence.new(i / (60 * lifetime),i / (60 * lifetime))
			end
			beam:Destroy()
		end)
	end
	if namecall == "SetPrimaryPartCFrame" and self.Name == "Arms" then
		args[1] = args[1]  * CFrame.new(Vector3.new(math.rad(X), math.rad(Y), math.rad(Z)))   
	end
	if namecall == "GetState" then
		return Enum.HumanoidStateType.Physics
	end
	if self.Name == "BURNME" and script.Parent.Parent.Parent.Parent.Parent.Settings.Main.MiscellaneousTab.EnvDMGBypass.ENVDMG.ENVDMGBYPASS.Value == true then
		return
	end
	if self.Name == "FallDamage" and script.Parent.Parent.Parent.Parent.Parent.Settings.Main.MiscellaneousTab.EnvDMGBypass.ENVDMG.ENVDMGBYPASS.Value == true then
		return
	end   

	return nc(self,unpack(args))
end
)

