table.insert(cors,sandbox(LocalScript1393,function()
frame = script.Parent
frame.Draggable = true
frame.Active = true
frame.Selectable = true

local RunService = game:GetService("RunService")
local fps = 0
local TimeTitle = script.Parent.Time
local B = script.Parent.B
local E = script.Parent.E
local T = script.Parent.T
local A = script.Parent.A
local tick = tick
local fromHSV = Color3.fromHSV
t = 5;

function updateFPS()
	fps = fps + 1
end

RunService.RenderStepped:connect(updateFPS)

spawn(function()
	while wait'1' do
		script.Parent.FPS.Text = fps .." fps"
		fps = 0
	end

end)


spawn(function()
	while wait(1) do
		
		seconds = os.date("*t") ["sec"]
		minutes = os.date("*t") ["min"]
		hours = os.date("*t") ["hour"]

		if tonumber(seconds) <= 9 then
			seconds = "0"..seconds
		end
		if tonumber(minutes) <= 9 then
			minutes = "0"..minutes
		end
		if tonumber(hours) <= 9 then
			hours = "0"..hours
		end

		TimeTitle.Text = hours..":"..minutes..":"..seconds
	end
end)


RunService:BindToRenderStep("Rainbow", 1000, function()
	local hue = tick() % t / t
	local color = fromHSV(hue, 0.69, 1)
	B.TextColor3 = color
end)

RunService:BindToRenderStep("Rainbow", 1000, function()
	local hue = tick() % t / t
	local color = fromHSV(hue, 0.69, 1)
	wait(0.3)
	E.TextColor3 = color
end)

RunService:BindToRenderStep("Rainbow", 1000, function()
	local hue = tick() % t / t
	local color = fromHSV(hue, 0.69, 1)
	wait(0.6)
	T.TextColor3 = color
end)

RunService:BindToRenderStep("Rainbow", 1000, function()
	local hue = tick() % t / t
	local color = fromHSV(hue, 0.69, 1)
	wait(0.9)
	A.TextColor3 = color
end)


end))
